[{"location":"reference/#Reference","page":"Reference","title":"Reference","text":"","category":"section"},{"location":"#TenNIS.jl","page":"Home","title":"TenNIS.jl","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"(Image: Stable) (Image: Dev) (Image: Build Status) (Image: Coverage) (Image: Code Style: Blue) (Image: Aqua)","category":"page"},{"location":"#Support","page":"Home","title":"Support","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"<img class=\"display-light-only\" src=\"assets/CCQ.png\" width=\"20%\" alt=\"Flatiron Center for Computational Quantum Physics logo.\"/>\n<img class=\"display-dark-only\" src=\"assets/CCQ-dark.png\" width=\"20%\" alt=\"Flatiron Center for Computational Quantum Physics logo.\"/>","category":"page"},{"location":"","page":"Home","title":"Home","text":"TenNIS.jl is supported by the Flatiron Institute, a division of the Simons Foundation.","category":"page"},{"location":"#Installation-instructions","page":"Home","title":"Installation instructions","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"This package resides in the ITensor/ITensorRegistry local registry. In order to install, simply add that registry through your package manager. This step is only required once.","category":"page"},{"location":"","page":"Home","title":"Home","text":"julia> using Pkg: Pkg\n\njulia> Pkg.Registry.add(url = \"https://github.com/ITensor/ITensorRegistry\")","category":"page"},{"location":"","page":"Home","title":"Home","text":"or:","category":"page"},{"location":"","page":"Home","title":"Home","text":"julia> Pkg.Registry.add(url = \"git@github.com:ITensor/ITensorRegistry.git\")","category":"page"},{"location":"","page":"Home","title":"Home","text":"if you want to use SSH credentials, which can make it so you don't have to enter your Github ursername and password when registering packages.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Then, the package can be added as usual through the package manager:","category":"page"},{"location":"","page":"Home","title":"Home","text":"julia> Pkg.add(\"TenNIS\")","category":"page"},{"location":"#Development-workflow","page":"Home","title":"Development workflow","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Follow these steps to develop TenNIS.jl and the associated tennis Python package simultaneously. First:","category":"page"},{"location":"","page":"Home","title":"Home","text":"julia> using Pkg: Pkg\n\njulia> Pkg.dev(\"TenNIS\")","category":"page"},{"location":"","page":"Home","title":"Home","text":"which installs TenNIS.jl for development, then:","category":"page"},{"location":"","page":"Home","title":"Home","text":"$ cd ~/.julia/dev/TenNIS\n\n$ pip install -e .","category":"page"},{"location":"","page":"Home","title":"Home","text":"which installs the associated tennis Python package for development. You should be able to run the example using the tennis Python package:","category":"page"},{"location":"","page":"Home","title":"Home","text":"$ python examples/example.py","category":"page"},{"location":"","page":"Home","title":"Home","text":"If you edit either the Julia package in ~/.julia/dev/TenNIS/src or the Python package in ~/.julia/dev/TenNIS/pysrc/tennis, modifications should show up when you rerun:","category":"page"},{"location":"","page":"Home","title":"Home","text":"$ python examples/example.py","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"This page was generated using Literate.jl.","category":"page"}]
